Popis rolí:



Interní role:



	team leader — hlavní odpovědností této role je starat se o fungování týmu, sledovat vývojový proces a jeho artefakty;
		analytik — odpovídá za sběr požadavků od zákazníka a jejich dokumentaci;
		architekt — odpovídá za návrh architektury a dohlíží na to, aby se během projektu tým od navržené architektury neodchýlil;
		release inženýr — má zodpovědnost za dodání hotového produktu zákazníkovi;
		systémový inženýr — role zodpovědná za nástroje a vývojové prostredí používané týmem;
		tester — zodpovídá za to, že všechny položky v plánu iterace prošly před jejich uzavřením nějakou formou testování;
		team leader — hlavní odpovědností této role je starat se o fungování týmu, sledovat vývojový proces a jeho artefakty; 
		vývojář — spoluzodpovědný za vývoj produktu, psaní a kvalitu zdrojového kódu.




Externí role:



	mentor — vyučující, pomáhá s nejasnostmi ohledně vývojového procesu a práce s podpůrnými nástroji, provádí pedagogický dohled nad týmem;
		zákazník — podílí se na tvorbě vize produktu, definuje jeho požadavky a hodnotí jejich splnění;
		kontaktní osoba - řídí směr vize projektu, v případě nedorozumění vyjasňuje správnost představy o projektu;
		uživatelé (ostatní) - skupina koncových uživatelů využívající aplikaci pro vlastní účely.




